function TelaInicial(){

    return(
        <div style={{background: "#1D1D21", width:12800, height:720}}>
            <div style={{background:"#2B2B31", height:66, width: "100%"}}>
            
                <Link to="/registrarProduto" style={{borderRadius: 6, border: "solid", borderColor: "#FFC55E" ,background: "#FFC55E", textDecoration: "none", color:"black", marginLeft: "1%", fontFamily: "Bebas Neue", fontSize: 36}}>ENTRAR SEM CADASTRO</Link>
            
